                        end
                    end
                    B(i+1,2*j-1)=maxindex;
                    B(i+1,2*j)=goalfnum-maxindex;
                end
            end
            %
            for i=1:n1
                if B(cellnum+1,i)~=0
                    rall=1;
                    for j=1:sm1
                        rall=reliability(sm1*(i-1)+j)*rall;
                    end
                    generatemode=nchoosek(1:sm1,B(cellnum+1,i));
                    probability=[];
                    for k=1:length(generatemode(:,1))
                        for s=1:length(generatemode(1,:))
                            probability(k)=rall/reliability(sm1*(i-1)+generatemode(k,s))*(1-reliability(sm1*(i-1)+generatemode(k,s)));
                        end
                    end
                    
                    random2=rand(1,length(generatemode(:,1)));
                    maxkey2=0;
                    for k=1:length(generatemode(:,1))
                        key2(k)=random2(k)^(sum(probability)/probability(k));
                        if key2(k)>maxkey2
                            maxkey2=key2(k);
                            maxindex2=k;
                        end
                    end
                    for s=1:length(generatemode(1,:))
                        state(generatemode(maxindex2,s)+sm1*(i-1))=0;
                    end
                end
            end
            
            for i=1:n2
                if B(cellnum+1,i+n1)~=0
                    rall=1;
                    for j=1:sm2
                        rall=reliability(sm1*n1+sm2*(i-1)+j)*rall;
                    end
                    generatemode=nchoosek(1:sm2,B(cellnum+1,i+n1));
                    probability=[];
                    for k=1:length(generatemode(:,1))
                        for s=1:length(generatemode(1,:))
                            probability(k)=rall/reliability(sm1*n1+sm2*(i-1)+generatemode(k,s))*(1-reliability(sm1*n1+sm2*(i-1)+generatemode(k,s)));
                        end
                    end
                    
                    random2=rand(1,length(generatemode(:,1)));
                    maxkey2=0;
                    for k=1:length(generatemode(:,1))
                        key2(k)=random2(k)^(sum(probability)/probability(k));
                        if key2(k)>maxkey2
                            maxkey2=key2(k);
                            maxindex2=k;
                        end
                    end
                    for s=1:length(generatemode(1,:))
                        state(generatemode(maxindex2,s)+sm1*n1+sm2*(i-1))=0;
                    end
                end
            end
            
            stateone=[stateone,state];
            x1f=sum(1-stateone(1:17));
            x2f=sum(1-stateone(18:89));
            x3f=sum(1-stateone(90:93));
            y1f=sum(1-stateone(94:136));
            y2f=sum(1-stateone(137:203));
            z1f=sum(1-stateone(204:215));
            z2f=sum(1-stateone(216:223));
            z3f=sum(1-stateone(224:261));

            if x1f>=2 || x2f>=2 || x3f>=2 || y1f>=2 || y2f>=2 || z1f>=2 || z2f>=2 || z3f>=2
                failstate=failstate+1;
            elseif y1f==1 && z1f==1 && z3f==1
                failstate=failstate+1;
            elseif y2f==1 && z2f==1 && z3f==1
                failstate=failstate+1;
            elseif y1f==1 && y2f==1 && z1f==1 && z2f==1
                failstate=failstate+1;
            elseif x3 ==1 && z1f==1 && z2f==1
                failstate=failstate+1;
            elseif x3 ==1 && y1f==1 && z2f==1 && z3f==1
                failstate=failstate+1;
            elseif x3 ==1 && y2f==1 && z1f==1 && z3f==1
                failstate=failstate+1;
            elseif x3 ==1 && y1f==1 && y2f==1
                failstate=failstate+1;
            elseif x1f==1 && x2f==1 && y1f==1 && y2f==1
                failstate=failstate+1;
            elseif x1f==1 && x2f==1 && z1f==1 && z2f==1
                failstate=failstate+1;
            elseif x1f==1 && x2f==1 && y1f==1 && z2f==1 && z3f==1
                failstate=failstate+1;
            elseif x1f==1 && x2f==1 && y2f==1 && z1f==1 && z3f==1
                failstate=failstate+1;
            elseif x1f==1 && x2f==1 && x3f==1
                failstate=failstate+1;
            end
        end
        
        stateall=[stateall;stateone];
        fiss(T,fnum+1)=1-failstate/MCnum1;
        ps=subsystemfinalm{1,1};
        systemr=systemr+fiss(T,fnum+1)*ps(fnum+1);
    end
    systemt(T)=systemr;
end
